import React from "react";

const Home = () => {
  return (
    <div>
      <img
        className="home-hero"
        width="1256"
        src="/image/arabica-6.png"
        alt="girl writing on giant paper"
      />
      <section>
        <div className="heroWrapper">
          <h1 className="homeHeading">Organize your work</h1>
          <a>Get Started</a>
        </div>
      </section>
    </div>
  );
};

export default Home;
